function I = fcnK1B(S, T, u, alpha, F, tol)
t1 = F .^ 2;t3 = S .^ 2;t7 = t1 .* S;t8 = (T .^ 2);t11 = t8 .* T;t15 = sqrt(u);t19 = S .* F;t24 = u .^ 2;t28 = t15 .* t24 .* u;t36 = F .* T;t38 = sqrt(t7 + t36 + u);t44 = log(0.1e1 ./ F .* (0.2e1 .* t38 .* t15 + t36 + 0.2e1 .* u));t51 = (t8 .^ 2);t71 = 0.48e2 ./ t1 ./ (0.32e2 .* S .* u - (8 .* t8)) ./ t38 ./ t28 .* (t15 .* u .* (0.13e2 ./ 0.6e1 .* T .* t3 .* t1 .* F + 0.31e2 ./ 0.12e2 .* t8 .* t7 - 0.5e1 ./ 0.24e2 .* t11 .* F) + t15 .* t24 .* (-t3 .* t1 + 0.5e1 ./ 0.6e1 .* T .* t19 + t8 ./ 0.12e2) - t28 .* S ./ 0.3e1 + (-0.10e2 .* t15 .* (t19 + T) .* t11 + (-0.24e2 .* u .* t8 .* S + 0.16e2 .* t24 .* t3 + (5 .* t51)) .* t38 .* t44) .* t1 ./ 0.16e2);
I = t71(:,:,2) - t71(:,:,1);

end
